			that.text.text ="2019新型冠状病毒（2019-nCoV），2020年1月12日被世界卫生组织命名。冠\r\n状病毒是一个大型病毒家族，已知可引起感冒以及中东呼吸综合征（MERS）\r\n和严重急性呼吸综合征（SARS）等较严重疾病。新型冠状病毒是以前从未在人\r\n体中发现的冠状病毒新毒株。\r\n\r\n2019年12月以来，湖北省武汉市持续开展流感及相关疾病监测，发现多起病毒\r\n性肺炎病例，均诊断为病毒性肺炎/肺部感染。 \r\n\r\n人感染了冠状病毒后常见体征有呼吸道症状、发热、咳嗽、气促和呼吸困难\r\n等。在较严重病例中，感染可导致肺炎、严重急性呼吸综合征、肾衰竭，甚至\r\n死亡。目前对于新型冠状病毒所致疾病没有特异治疗方法。但许多症状是可以\r\n处理的，因此需根据患者临床情况进行治疗。此外，对感染者的辅助护理可能\r\n非常有效。\r\n\r\n做好自我保护包括：保持基本的手部和呼吸道卫生，坚持安全饮食习惯，并尽\r\n可能避免与任何表现出有呼吸道疾病症状（如咳嗽和打喷嚏等）的人密切接\r\n触。";
