			that.text.text = "感染病毒的人会出现程度不同的症状，有的只是发烧或轻微咳嗽，有的会发展\r\n为肺炎，有的则更为严重甚至死亡。\r\n\r\n该病毒致死率约为2%到4%，但这是一个非常早期的百分比，随着更多信息的\r\n获得可能会改变。同时，这并不意味着它不严重，只是说病毒感染者不一定人\r\n人都会面临最严重的后果。";
